import React from 'react';
import Layout from '../Layout/Layout';
import Input from '../UI/Input/Input';
import styles from './UserDetail.module.scss';
const UserDetail = () =>{
    return(
        <Layout title='Chỉnh Sửa Người Dùng'>
            <form>
            <Input className={styles.input} label='Email' input={{
                type: 'email',
                required: true,
                id: 'email'
            }}/>
            <Input className={styles.input} label='Mật khẩu' input={{
                type: 'password',
                required: true,
                id: 'password',
                min: '8'
            }}/>
            </form>
        </Layout>
    )
}

export default UserDetail;
